    def __create_engine(self):
        return sqla.create_engine(
            f"mssql+pymssql://{self.AUTH['user']}:{self.AUTH['pwd']}@{self.SERVER}:1433/{self.DATABASE}?charset=utf8"
        )

    def execute_query(self, sql):
        # replace all and's with lower case and
        sql = sql.replace(" AND ", " and ")
        sql = sql.replace(
            " and '", " &&& '"
        )  # separates datetime strings, not conditions.
        df = None
        # calls without where
        if "where" not in sql:  # "select * from {table}"
            query_words = sql.split(" ")
            db = query_words[3]
            df = getattr(self, db)

        # calls with where
        else:
            table_query, conditions = sql.split(" where ")
            db = table_query.split(" ")[3]
            df = getattr(self, db)

            # delete rows that don't match conditions
            for condition in re.split(" and ", conditions):
                if condition == "1=0":
                    df = df[0:0]
                    break
                if condition == "1=1":
                    continue

                # parse conditions 1 by 1
                if "=" in condition:  # "... video_id=1"
                    col_name, value = condition.split("=")
                    col_name, value = col_name.strip(), value.strip()
                    if value[0] == "'":
                        value = value[1:-1]
                    if value.isdigit() or "." in value:
                        value = int(float(value))
                    df = df[df[col_name] == value]
                elif " in " in condition:  # "... video_id in (0, 1, 2)"
                    col_name, values = condition.split(" in ")
                    values = values[1:-1].split(", ")
                    values = [int(v) for v in values]
                    df = df[df[col_name].isin(values)]
                elif (
                    "JSON_VALUE" in condition
                ):  # "... JSON_VALUE(metadata, '$.{key}') like '%{val}%'"
                    left, right = condition.split(" like ")
                    last_key = left.split(".")[-1][:-2]
                    value = right[1:-1]
                    regex_value = "".join([".*" if c == "%" else c for c in value])
                    df = df[
                        df["metadata"].str.contains(
                            f'"{last_key}": "{regex_value}"',
                            flags=re.IGNORECASE,
                            regex=True,
                            na=False,
                        )
                    ]
                elif (
                    "between" in condition
                ):  # timestamp between '2023-07-07 09:30:00' AND '2023-07-07 09:31:30'
                    col_name, two_times = condition.split(" between ")
                    start, end = two_times.split(" &&& ")
                    start, end = start[1:-1], end[1:-1]
                    df = df[(df[col_name] >= start) & (df[col_name] <= end)]
                else:  # "... segment like '%[^a-zA-Z]en%'"
                    col_name, regex_condition = condition.split(" like ")
                    regex_condition = regex_condition[1:-1]
                    regex_condition = "".join(
                        [".*" if c == "%" else c for c in regex_condition]
                    )
                    df = df[
                        df[col_name].str.contains(
                            regex_condition, flags=re.IGNORECASE, regex=True, na=False
                        )
                    ]
        return df


